//ROUTERS ---->link specific components one page to another page ("link tag")
//applicable both claass and functions

import { BrowserRouter, Link, Route, Router, Routes } from "react-router-dom";

function Appp() {
    return (
        <div>
            <Router>
                <ul>
                    <li>
                        <Link to="./a">home</Link>
                        <Link to="./b">about</Link>
                        <Link to="./c">servises</Link>
                        <Link to="./d">contacted us</Link>
                    </li>

                </ul>
                <Routes>
                    <Route path="/a" element={<home />}></Route>
                </Routes>
            </Router>
        </div>
    )

}
